import logo from './logo.svg';
import './App.css';
import styled from 'styled-components';

const Button = styled.button`
  background: blue;
`

function Bouton({ children, onClick }) {
  return (
    <div onClick={onClick}>{children}</div>
  )
}

function App() {
  const vara = "salut";
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <p>
          Edit <code>src/App.js</code> and save to reload.
        </p>
        <Bouton onClick={() => console.log('salut')}>{vara}</Bouton>
        <Bouton onClick={() => console.log('VOUVOU')}>Salut</Bouton>
        <Bouton onClick={() => console.log('MLDKFMSD')}>Salut</Bouton>
        <Bouton onClick={() => console.log('salut')}>Salut</Bouton>
        <Bouton onClick={() => console.log('salut')}>Salut</Bouton>
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>
      </header>
    </div>
  );
}

export default App;
